INSERT INTO `common_symptoms` VALUES (1,'influenza (flu)','signs and symptoms: fever, chills, cough, sore throat, muscle aches, fatigue, headache, nasal congestion, and sometimes gastrointestinal symptoms like nausea and vomiting.\n\nadditional information: influenza is caused by the influenza virus and can spread easily from person to person, especially during flu seasons. vaccination is recommended annually to prevent infection.',1,'symptom_9b16405b0557ed073710cda2e12274ac.jpg',150,'Fever, chills, cough, sore throat, muscle aches, fatigue, headache, nasal congestion',1,3,'2024-04-16 11:51:13','2024-04-16 11:51:13'),(2,'hypertension (high blood pressure)','signs and symptoms: often asymptomatic, but symptoms can include headaches, shortness of breath, nosebleeds, and dizziness.\n\nadditional information: hypertension is a chronic condition characterized by elevated blood pressure in the arteries. it can lead to serious health complications such as heart disease, stroke, and kidney damage if left untreated.',5,'symptom_d49addf845831958fb134d95987b4dbb.png',200,'headaches, shortness of breath, nosebleeds, and dizziness',1,3,'2024-04-16 11:57:43','2024-04-16 11:57:43'),(3,'common cold updated','The common cold is an infection of your nose, sinuses, throat and windpipe. Colds spread easily, especially within homes, classrooms and workplaces. More than 200 different viruses can cause colds. Theres no cure for a common cold, but it usually goes away within a week to 10 days. If you dont feel better in 10 days, see a healthcare provider.',1,'symptom_27055bed8f823b804ccb559a1cbd2e14.jpg',200,'sneezing, runny nose, stuffy nose, cough, headaches, fatigue',1,3,'2024-04-16 12:00:57','2024-12-11 12:12:33');
