INSERT INTO `doctors` VALUES (2,11,'Dr.','Nyalema','Victoria','Moiwa','female','With over a decade of dedicated service in the medical field, Nyalema is a seasoned heart surgeon renowned for her expertise and compassionate patient care. Having traversed both governmental and non-governmental spheres, she brings a wealth of experience and a diverse perspective to her practice.\n\nNyalema\'s journey in healthcare has been marked by over 50 successful heart surgeries, each a testament to her precision, skill, and unwavering commitment to excellence. Her journey has evolved to include the establishment of her own private medical center, where she continues to provide cutting-edge treatments and personalized care to her patients.\n\nBeyond her clinical practice, Nyalema is a passionate advocate for child health, recognizing the importance of early intervention and preventive measures in shaping healthier futures. Her collaboration with esteemed organizations such as the World Health Organization (WHO) reflects her dedication to advancing global health initiatives and addres','1fec5e146395499c9dfba21cb60a3f37.png',1,'Heart Surgeon | Healthcare Advocate',1.00,NULL,1,12,1,3,'2024-03-01 11:36:30','2024-05-13 11:09:57'),(11,56,'Dr.','Nathaniel','Ainajoko','Williams','male','A medical officer with years of experience in both clinical and administrative fields','b9efd764e570bcfac1c0f9c9deba2cdb.jpeg',2,'MBChB',250.00,NULL,1,9,1,3,'2024-05-08 14:44:34','2024-05-08 16:28:21'),(12,67,'Nur','Amarachi','Josephine','Eke','male','My name is Chinedum Roland and I am a very professional doctor\n','59c8b0e3b69a6f5d438313e8fdfb930d.JPG',1,'Mba Nursing',1.00,NULL,1,5,1,3,'2024-05-28 16:54:42','2024-11-28 13:46:16'),(13,71,'Dr.','Haja','Safiyatu','Sovula','female','To be changed ','f9da2601c15b87694f03c5ea3d17f83e.jpeg',1,'Mb.Ch.B, MPH, Pgdip.Child Health, Pgdip.Neonatology, MWACP',200.00,NULL,1,8,1,3,'2024-06-18 10:45:14','2024-06-18 15:18:37'),(14,73,'Dr.','Peter','','Mac-Jajua','male','.