INSERT INTO `medical_specialities` VALUES (1,'pediatricians','they care for children from birth to young adulthood. some pediatricians specialize in pre-teens and teens, child abuse, or children&#x27;s developmental issues.','aeec0b5c63696a74c72ae3daa68f391a.png',NULL,1,1,'2023-12-19 18:21:53','2024-02-15 11:44:48'),(2,'family physician','they care for the whole family, including children, adults, and the elderly. they do routine checkups and screening tests, give you flu and immunization shots, and manage diabetes and other ongoing medical conditions.','549750abedee23c34f6f260843dd6154.jpg',NULL,1,1,'2023-12-19 18:23:00','2024-02-15 11:45:50'),(3,'anesthesiologists','these doctors give you drugs to numb your pain or to put you under during surgery, childbirth, or other procedures. they monitor your vital signs while youre under anesthesia.','74bb95e07cd473e3dee44e198837022d.png',NULL,1,3,'2024-02-15 11:46:12','2024-02-15 11:46:12'),(4,'allergists&#x2F;immunologist','they treat immune system disorders such as asthma, eczema, food allergies, insect sting allergies, and some autoimmune diseases.','c10c6ef6fe29dcf7b9f54ee034049f80.jpg',NULL,1,3,'2024-02-15 11:46:57','2024-02-15 11:46:57'),(5,'cardiologist','theyre experts on the heart and blood vessels. you might see them for heart failure, a heart attack, high blood pressure, or an irregular heartbeat.','583c7966903a348ea61ae12a7e134bad.png',NULL,1,3,'2024-02-15 11:48:20','2024-02-15 11:48:20'),(6,'dermatologists','have problems with your skin, hair, nails? do you have moles, scars, acne, or skin allergies? dermatologists can help.','f7f6b34914ed8c4451f9c561188ef15b.png',NULL,1,3,'2024-02-15 11:50:07','2024-02-15 11:50:07'),(7,'critical care medicine specialists','they care for people who are critically ill or injured, often heading intensive care units in hospitals. you might see them if your heart or other organs are failing or if youve been in an accident.','acf64cd5c1ac222ce81968d946c3f7cd.png',NULL,1,3,'2024-02-15 11:52:18','2024-02-15 11:52:18'),(8,'endocrinologists','these are experts on hormones and metabolism. they can treat conditions like diabetes, thyroid problems, infertility, and calcium and bone disorders.','9bc73e1d5591d2a99aed6a33f6c8e08c.png',NULL,1,3,'2024-02-15 11:53:30','2024-02-15 11:53:30'),(9,'internal medcine','Internists often work as primary care physicians, providing comprehensive care and coordinating with specialists when necessary to ensure patients receive appropriate treatment for their specific conditions.','9f583ced4d2551627a7a1cc125c0cd81.jpg',NULL,1,3,'2024-07-01 13:21:19','2024-07-05 15:31:00'),(10,'general medicine','general medicine (also known as internal medicine) is a medical specialization focused on the prevention, diagnosis, and treatment of a wide range of adult diseases. general medicine doctors, known as physicians or internists, manage complex and chronic illnesses such as diabetes, hypertension, respiratory conditions, and heart disease. they provide comprehensive care, coordinate with specialists when necessary, and often serve as the first point of contact for patients seeking medical advice or treatment.','632ffb7fe45af635a5aaab6a1295cf6c.jpg',NULL,1,3,'2025-02-14 22:17:43','2025-02-14 22:17:43');
/*!40000 ALTER TABLE `medical_specialities` ENABLE KEYS */;
UNLOCK TABLES;

