INSERT INTO `patients_testimonial` VALUES (2,4,'I cannot express how grateful I am for Kenecare Telehealth! As a busy working mom, finding time to schedule and attend in-person medical appointments was always a challenge. With Kenecare, I can conveniently consult with healthcare professionals from the comfort of my home. Recently, I used the app to discuss pre-pregnancy health concerns, and the doctor provided valuable insights and personalized recommendations. Kenecare has truly simplified healthcare for me, and I highly recommend it to anyo',1,1,3,'2024-03-26 06:01:18','2024-12-11 19:19:26');
